parse:
run Pos1 {
    some disj P1 : Person | some disj C1 : Course | some disj G1, G2 : Grade {
        // universe
        Person = P1
        Professor = P1
        Student = none
        Course = C1
        Project = none
        Grade = G1 + G2

        // teaching and enrollment
        teaches = P1->C1
        enrolled = none

        // projects per course and per person
        Course <: projects = none->none
        Person <: projects = none->none

        // grades and ordering
        grades = none->none->none
        Grade <: next = G1->G2
    }
} for 1 Person, 1 Course, 0 Project, 2 Grade expect 1

valid:
run Neg1 {
    some disj P1,P2 : Person | some disj C1 : Course | some disj G1,G2 : Grade {
        Person = P1 + P2
        Professor = P1 + P2
        Student = P2                                      // only P2 (a prof) is a student
        Course = C1
        Project = none
        Grade = G1 + G2

        Person <: teaches = P1->C1
        Person <: enrolled = P2->C1                       // professor P2 enrolled in P1's course
        Person <: projects = none->none
        Course <: projects = none->none
        Course <: grades = none->none->none
        Grade <: next = G1->G2

        // Violates "A professor cannot teach colleagues" since P1 teaches colleague P2.
        // Other constraints hold and no self-teaching (P1 not enrolled).
    }
} for 2 Person, 1 Course, 0 Project, 2 Grade expect 0

run Neg2 {
    some disj P1,P2,P3 : Person | some disj C1,C2 : Course | some disj G1,G2 : Grade {
        Person = P1 + P2 + P3
        Professor = P1 + P2
        Student = P2 + P3
        Course = C1 + C2
        Project = none
        Grade = G1 + G2

        Person <: teaches = P1->C1 + P1->C2
        Person <: enrolled = P2->C2 + P3->C1              // P2 (a professor) enrolled in P1's course C2
        Person <: projects = none->none
        Course <: projects = none->none
        Course <: grades = none->none->none
        Grade <: next = G1->G2

        // Violates "A professor cannot teach colleagues" (P1 teaches C2, P2 enrolled in C2).
        // No professor teaches herself (P2 not teaching C2; P1 not enrolled).
    }
} for 3 Person, 2 Course, 0 Project, 2 Grade expect 0

run Neg3 {
    some disj P1,P2 : Person | some disj C1 : Course | some disj PR1 : Project | some disj G1,G2 : Grade {
        Person = P1 + P2
        Professor = P1 + P2
        Student = P2
        Course = C1
        Project = PR1
        Grade = G1 + G2

        Person <: teaches = P1->C1
        Person <: enrolled = P2->C1
        Person <: projects = P2->PR1                      // student works on a project
        Course <: projects = C1->PR1                      // project proposed by exactly one course
        Course <: grades = none->none->none
        Grade <: next = G1->G2

        // Violates "A professor cannot teach colleagues" (P1 teaches C1, P2 enrolled in C1).
        // No self-teaching (P1 not enrolled, P2 not teaching).
    }
} for 2 Person, 1 Course, 1 Project, 2 Grade expect 0

run Neg4 {
    some disj P1,P2 : Person | some disj C1,C2 : Course | some disj G1,G2 : Grade {
        Person = P1 + P2
        Professor = P1 + P2
        Student = P2
        Course = C1 + C2
        Project = none
        Grade = G1 + G2

        Person <: teaches = P1->C1 + P2->C2               // each course has a teacher
        Person <: enrolled = P2->C1                       // colleague enrolled in P1's course
        Person <: projects = none->none
        Course <: projects = none->none
        Course <: grades = none->none->none
        Grade <: next = G1->G2

        // Violates "A professor cannot teach colleagues" (P1 teaches C1, P2 enrolled in C1).
        // No self-teaching (P2 teaches C2, but is enrolled only in C1).
    }
} for 2 Person, 2 Course, 0 Project, 2 Grade expect 0

run Neg5 {
    some disj P1,P2,P3,P4 : Person | some disj C1,C2 : Course | some disj PR1,PR2 : Project | some disj G1,G2,G3 : Grade {
        Person = P1 + P2 + P3 + P4
        Professor = P1 + P2 + P4
        Student = P2 + P3
        Course = C1 + C2
        Project = PR1 + PR2
        Grade = G1 + G2 + G3

        Person <: teaches = P1->C1 + P4->C2               // both courses have professors
        Person <: enrolled = P2->C1 + P3->C2              // P2 (prof) enrolled in C1 taught by P1
        Person <: projects = P2->PR1 + P3->PR2            // only students work on projects
        Course <: projects = C1->PR1 + C2->PR2            // each project proposed by exactly one course
        Course <: grades = none->none->none
        Grade <: next = G1->G2 + G2->G3

        // Violates "A professor cannot teach colleagues" (P1 teaches C1, P2 enrolled in C1).
        // No self-teaching (P2 not teaching C1; teachers not enrolled in their own courses).
        // All project constraints satisfied.
    }
} for 4 Person, 2 Course, 2 Project, 3 Grade expect 0
